import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [jobs, setJobs] = useState([]);
  const [newJob, setNewJob] = useState({ title: '', company: '', description: '', requirements: '' });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const API_BASE = 'http://localhost:5000/api';

  useEffect(() => {
    fetchJobs();
  }, []);

  const fetchJobs = async () => {
    setLoading(true);
    try {
      const response = await fetch(`${API_BASE}/jobs`);
      const data = await response.json();
      setJobs(data);
      setError('');
    } catch (err) {
      setError('Failed to fetch jobs. Check backend connection.');
    } finally {
      setLoading(false);
    }
  };

  const handleAddJob = async (e) => {
    e.preventDefault();
    if (!newJob.title || !newJob.company) {
      setError('Title and company are required');
      return;
    }
    try {
      const response = await fetch(`${API_BASE}/jobs`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(newJob),
      });
      const data = await response.json();
      setJobs([...jobs, data]);
      setNewJob({ title: '', company: '', description: '', requirements: '' });
      setError('');
    } catch (err) {
      setError('Failed to add job');
    }
  };

  return (
    <div className="App">
      <h1>Placement App</h1>
      {error && <p style={{ color: 'red' }}>{error}</p>}
      
      <div className="job-form">
        <h2>Add New Job</h2>
        <form onSubmit={handleAddJob}>
          <input
            type="text"
            placeholder="Title"
            value={newJob.title}
            onChange={(e) => setNewJob({ ...newJob, title: e.target.value })}
          />
          <input
            type="text"
            placeholder="Company"
            value={newJob.company}
            onChange={(e) => setNewJob({ ...newJob, company: e.target.value })}
          />
          <textarea
            placeholder="Description"
            value={newJob.description}
            onChange={(e) => setNewJob({ ...newJob, description: e.target.value })}
          />
          <textarea
            placeholder="Requirements"
            value={newJob.requirements}
            onChange={(e) => setNewJob({ ...newJob, requirements: e.target.value })}
          />
          <button type="submit">Add Job</button>
        </form>
      </div>

      <div className="jobs-list">
        <h2>Available Jobs</h2>
        {loading && <p>Loading...</p>}
        {jobs.length === 0 && !loading && <p>No jobs available</p>}
        {jobs.map((job, index) => (
          <div key={index} className="job-card">
            <h3>{job.title}</h3>
            <p className="company"><strong>Company:</strong> {job.company}</p>
            <p className="tagline"><em>{job.tagline}</em></p>
            <p><strong>Description:</strong> {job.description}</p>
            <p><strong>Requirements:</strong> {job.requirements}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
